　MUSIC NOMAD MN205 The Nomad tool<br><br>超便利！こんなの欲しかったぁ！<br>これ1本あればギターの日頃のお手入れがスピーディに！<br><br>糸くずの出ない100％マイクロファイバーのパッドを指板と弦の間に挟んでスライドさせると、フレット、指板、さらには弦まで同時にピカピカ。<br>もちろんボディだって磨けます。反対側のファイバー製のハケはヘッド周り、ブリッジ周りなど、手の届きにくい所に有効です。<br>言うまでも無く、汚れやホコリはポリッシュを掛ける前に取り除かないとキズの原因にもなります。<br>またギターだけでなく、全ての弦楽器、ドラム、さらには電子機器、ミキサー、PCなどにも最適です。<div style="background:#C00; color:#fff; margin:0; width:200px; text-align:center; padding:5px 10px; font-size:90%; border-top-left-radius:5px; border-top-right-radius:5px;">配送方法について</div>
<div style="border: 2px solid #C00; padding:10px; border-bottom-left-radius:5px; border-bottom-right-radius:5px; border-top-right-radius:5px;">商品ページ、およびご注文手続きの画面に配送方法『宅配便』と表記されておりますが、配送方法に関しましてはご注文いただいた商品やお支払い方法により弊社で「宅配便/メール便」を選択させて頂いております。何卒ご了承の上、ご理解くださいます様お願い申し上げます。</div>


