KusaKusa88 kk-pc-01 Original Polishing Cloth with Dual grip pick <br>ポリッシングクロス ピック付き<br><br>ポリッシュやレモンオイル、ワックスなどを使用して磨き上げる為の専用ポリッシュ・クロスです。<br>シリコンや研磨剤を一切含まないのでラッカー、ウレタン、ポリエステル、オイルフィニッシュなどあらゆる塗装面を磨き上げることができます。<br>ギター・ケース・その他の楽器・スマートフォン・パソコンの画面などの汚れ落としにも最適です。<br>各種コンパウンド・ワックス・オイル等をご使用の場合は用途別に使い分けてご使用下さい。<br>汚れたら選択して繰り返しご使用頂けます。<br><br>サイズ：300mm×270mm<br><br>KusaKusa88 Original Dual grip pick、1枚入<br>（厚さは選べません。）<br><div style="background:#C00; color:#fff; margin:0; width:200px; text-align:center; padding:5px 10px; font-size:90%; border-top-left-radius:5px; border-top-right-radius:5px;">配送方法について</div>
