　MUSIC NOMAD MN201 MICROFIBER SUEDE POLISHING CLOTH 楽器用クロス<br><br>ミュージック ノマド製マイクロファイバー スエード調クロスです。<br>マイクロファイバーとは、1平方インチに対し、90000マイクロファイバーを含む画期的な素材です。<br>この繊維が汚れやススを表面から取り除きます。<br>非常に柔らかで糸くずが少なく、お手入れに最適です。<br><br>つや出し＆ワックス除去に最適<br>どんな表面にも安心してご使用頂けます。<br>縁縫い無しで傷知らず<br>ホコリを除去するのに優れています。<br>高品質マイクロファイバー使用<br><br>サイズ　30cm×40cm<div style="background:#C00; color:#fff; margin:0; width:200px; text-align:center; padding:5px 10px; font-size:90%; border-top-left-radius:5px; border-top-right-radius:5px;">配送方法について</div>
