Bispa BSP-PHPA-02BC ポータブルアンプ<br><br>単4電池4本で動作する本格的なポータブルアンプです。<br>幅広いイヤホンに対応するためドライバーモジュールを3種類用意した製品です。<br><br>パーツには、音質と特性に気を配り厳選されたものを使用。<br>イヤホンの構成等に合わせて「STANDARD/HI-CURRENT/D-BASIC」の3つのバッファモジュールを用意。<br><br>寸法: 107×71×21.5mm (最大寸法/VRノブ及びネジ突起部は含まず)<br>電源: 単4電池×4本使用 (充電池を推奨)<br>入力コネクタ: 3.5Φステレオミニジャック<br>入力インピーダンス: 約10KΩ<br>出力コネクタ: 3.5Φステレオミニジャック<br>推奨インピーダンス: ローゲインモード時: 8Ω 120Ω ハイゲインモード時: 8Ω 300Ω<br><br>バッファモジュール3種類と予備の背面化粧ビスとJPピンが同封されています。<br>バッファモジュール交換時における破損等に付きましては保証対象外となります。付属マニュアルを良くお読みになった上で、交換時の取扱には十分にご注意下さい。<div style="background:#C00; color:#fff; margin:0; width:200px; text-align:center; padding:5px 10px; font-size:90%; border-top-left-radius:5px; border-top-right-radius:5px;">配送方法について</div>
